Autorization
Following rules apply for access control

Access control applies only on updates (using PUT verb against /persistence/questionnaires/{id})
Permissions are verified using the 'permission' attribute of the user under control.

User attributes are given by the constructor of the User model entity:
    public User(
            String id,
            String name,
            String firstName,
            String lastName,
            String permission
    ) {
        this.id = id;
        this.name = name;
        this.permission = permission;
        this.firstName = firstName;
        this.lastName = lastName;
    }

Access control is implemented using a jersey filter defined in  OwnerRestrictedFilter.java. 
This allow us to apply access control by adding the @OwnerRestricted annotation on any resource accepting a pogues model entity as a payload.
For better comprehension here is the test class fr OwnerRestrictedFilter 
package fr.insee.pogues.jersey;

import fr.insee.pogues.persistence.service.QuestionnairesService;
import fr.insee.pogues.user.model.User;
import fr.insee.pogues.user.query.UserServiceQuery;
import fr.insee.pogues.webservice.rest.OwnerRestrictedFilter;
import fr.insee.pogues.webservice.rest.PoguesException;
import org.glassfish.jersey.server.ContainerRequest;
import org.json.simple.JSONObject;
import org.junit.Before;
import org.junit.Rule;
import org.junit.Test;
import org.junit.rules.ExpectedException;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.Mockito;

import javax.ws.rs.core.SecurityContext;
import java.security.Principal;

import static org.junit.Assert.assertEquals;
import static org.mockito.Mockito.*;
import static org.mockito.MockitoAnnotations.initMocks;

public class TestOwnerRestrictedFilter {

    @Mock
    QuestionnairesService questionnaireService;

    @Mock
    UserServiceQuery userServiceQuery;

    @InjectMocks
    OwnerRestrictedFilter filter;

    @Rule
    public ExpectedException exception = ExpectedException.none();

    @Before
    public void setUp(){
        filter = spy(new OwnerRestrictedFilter());
        initMocks(this);
    }

    @Test // No payload attached =>  400|Bad Request
    public void filterWithNullBodyException() throws Exception {
        exception.expectMessage("Bad Request");
        exception.expect(PoguesException.class);
        try {
            filter(null);
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            assertEquals("No body attached to request", detailedMessage);
            throw e;
        }
    }

    @Test // Id not found in payload =>  400|Bad Request
    public void filterWithNullIdException() throws Exception {
        exception.expectMessage("Bad Request");
        exception.expect(PoguesException.class);
        try {
            filter(new JSONObject());
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            assertEquals("Missing attribute 'id' in Request Payload", detailedMessage);
            throw e;
        }
    }

    @Test// Owner not found in payload =>  400|Bad Request
    public void filterWithNullOwnerException() throws Exception {
        exception.expectMessage("Bad Request");
        exception.expect(PoguesException.class);
        JSONObject payload = new JSONObject();
        payload.put("id", "foo");
        Mockito.when(questionnaireService.getQuestionnaireByID("foo"))
                .thenReturn(payload);
        try {
            filter(payload);
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            assertEquals("Request payload does not have an owner attribute",
                    detailedMessage);
            throw e;
        }
    }

    @Test
    public void filterWithUnauthorizedException() throws Exception {
        exception.expectMessage("Unauthorized");
        exception.expect(PoguesException.class);
        try {
            JSONObject payload = new JSONObject();
            payload.put("id", "ENTITY-ID");
            payload.put("owner", "A-USER-GROUP");
            ContainerRequest crc = mock(ContainerRequest.class);
            when(crc.readEntity(JSONObject.class))
                    .thenReturn(payload);
            when(crc.getSecurityContext()).thenReturn(new SecurityContext() {
                @Override
                public Principal getUserPrincipal() {
                    return /* principal name */() -> "CURRENT-USER-ID";
                }

                @Override
                public boolean isUserInRole(String s) {
                    return false;
                }

                @Override
                public boolean isSecure() {
                    return false;
                }

                @Override
                public String getAuthenticationScheme() {
                    return null;
                }
            });
            JSONObject storedEntity = new JSONObject();
            storedEntity.put("owner", "ANOTHER-GROUP");
            when(questionnaireService.getQuestionnaireByID("ENTITY-ID"))
                    .thenReturn(storedEntity);
            when(userServiceQuery.getNameAndPermissionByID("CURRENT-USER-ID"))
                    .thenReturn(new User("CURRENT-USER-ID",
                            "John Doe",
                            "John",
                            "Doe",
                            "NON-MATCHING-GROUP"));
            filter.filter(crc);
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            int status = ((PoguesException)e).toRestMessage().getStatus();
            assertEquals("This object is not yours", detailedMessage);
            assertEquals(403, status);
            throw e;
        }
    }

    @Test
    public void filterWithUnauthenticatedException() throws Exception {
        exception.expectMessage("Unauthenticated");
        exception.expect(PoguesException.class);
        try {
            JSONObject payload = new JSONObject();
            payload.put("id", "ENTITY-ID");
            payload.put("owner", "A-USER-GROUP");
            ContainerRequest crc = mock(ContainerRequest.class);
            when(crc.readEntity(JSONObject.class))
                    .thenReturn(payload);
            when(crc.getSecurityContext()).thenReturn(new SecurityContext() {
                @Override
                public Principal getUserPrincipal() {
                    return null;
                }

                @Override
                public boolean isUserInRole(String s) {
                    return false;
                }

                @Override
                public boolean isSecure() {
                    return false;
                }

                @Override
                public String getAuthenticationScheme() {
                    return null;
                }
            });
            when(questionnaireService.getQuestionnaireByID("ENTITY-ID"))
                    .thenReturn(payload);
            filter.filter(crc);
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            int status = ((PoguesException)e).toRestMessage().getStatus();
            assertEquals("You are not logged in", detailedMessage);
            assertEquals(401, status);
            throw e;
        }
    }

    private void filter(JSONObject payload) throws Exception  {
        ContainerRequest crc = mock(ContainerRequest.class);
        when(crc.readEntity(JSONObject.class))
                .thenReturn(payload);
        filter.filter(crc);
    }


}

conversions/.body:
Data Format Conversions
Moving from one data format to another is one of the core features of Pogues. This transformations may be accomplished using XSL transformations, external API calls, a set of serializer or whatever future expectation may require. Transformations may be chained together as well as used separately.
To help will this, every transformation implementation will have to rely on a common interface, easing the process of chaining or swapping transformations all accross the application.
The Transformer  Interface
Consequently, as soon as we need to implement a transformation we will implement the Transformer interface which defines a set of transform methods with different types of inputs and outputs.
package fr.insee.pogues.transforms;

import java.io.InputStream;
import java.io.OutputStream;
import java.util.Map;

public interface Transformer {
    void transform(InputStream input, OutputStream output, Map params) throws Exception;
    String transform(InputStream input, Map params) throws Exception;
    String transform(String input, Map params) throws Exception;

}

